PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;

CREATE TABLE DISTRICTS 
(
	CODE NUMERIC(2,0), 
	NAME VARCHAR(50), 
	REGION VARCHAR(1),
        PRIMARY KEY (CODE)
);
	


CREATE TABLE MUNICIPALITIES
(
   CODE NUMERIC(4,0), 
   NAME VARCHAR(50),
   DISTRICT NUMERIC(2,0),
   PRIMARY KEY (CODE),
   FOREIGN KEY (DISTRICT) REFERENCES DISTRICTS(CODE)
);


CREATE TABLE LISTS
(
    DISTRICT NUMERIC(2,0),
    PARTY VARCHAR(10),
    SEATS NUMERIC(2,0),
    PRIMARY KEY(DISTRICT,PARTY),
    FOREIGN KEY(DISTRICT) REFERENCES DISTRICTS(CODE),
    FOREIGN KEY(PARTY) REFERENCES PARTIES(ACRONYM));


CREATE TABLE PARISHES 
(
	CODE NUMERIC(6,0), 
	NAME VARCHAR(50),
	MUNICIPALITY NUMERIC(4,0),
	PRIMARY KEY (CODE),
	FOREIGN KEY (MUNICIPALITY) REFERENCES MUNICIPALITIES(CODE)
);


CREATE TABLE PARTIES
(
     ACRONYM VARCHAR(10), 
     DESIGNATION VARCHAR(100),
     PRIMARY KEY (ACRONYM)
);


CREATE TABLE PARTICIPATIONS
(
     DISTRICT NUMERIC(2,0),
     REGISTERED_VOTERS NUMERIC(10,0),
     VOTERS NUMERIC(10,0),
     ABSTENTIONS NUMERIC(10,0),
     BLANK_VOTES NUMERIC(10,0),
     NULL_VOTES NUMERIC(10,0),
     PRIMARY KEY(DISTRICT),
     FOREIGN KEY(DISTRICT) REFERENCES DISTRICTS(CODE)
);


CREATE TABLE VOTINGS
(
     PARISH NUMERIC(6,0),
     PARTY VARCHAR(10),
     VOTES NUMERIC(10,0),
     PRIMARY KEY(PARISH,PARTY),
     FOREIGN KEY(PARISH) REFERENCES PARISHES(CODE),
     FOREIGN KEY(PARTY) REFERENCES PARTIES(SIGLA)
);

COMMIT;
